INSERT INTO `hotel` (`id`, `name`, `description`, `email`, `ort_id`, `telefon`, `adresse`, `anfahrtsbeschreibung`, `kategorie`, `bewertung`) VALUES
('Active by Leitners Stylehotel Spa', 'Active by Leitners Stylehotel Spa', 'Die Zimmer & Suiten unseres Hotels sind alles andere als gewöhnlich - viel Glas und die tolle Lage bringen Sie der Natur ganz nah. Alle Zimmer sind mit Dusche oder Badewanne/WC, Fön, TV, Internet, Schreibtisch und teilweise Minibar ausgestattet und verfügen über einen großen Sonnenbalkon oder Terrasse.\r\n\r\nKostenloses W-Lan in allen Zimmern, ausgenommen in \"M*\" DesignZimmer, da diese Zimmer baubiologisch vollkommen \"gesund\" gebaut und strahlenabgeschirmt sind. Diese DesignZimmer sind jedoch mit kostenlosem HighSpeedLAN ausgestattet.\r\n\r\nCa. 6 Autominuten vom TAUERN SPA Zell am See - Kaprun entfernt, 4 Skigebiete in 3-10 Autominuten erreichbar (2 Gehminuten zum Skibus).', 'rezeption@Leitner.at', 6, '(07583) 67 53', 'Kitzsteinhornstraße 10 5710 Kaprun', 'Von Salzburg:\r\n\r\nBad Tölz - A95 - Oberau - Ettal - Linderhof - Grenze Ammerwald - Plansee - Reutte - Lechtal -Warth - Hochkrumbach', 3, 1.01),
('Clubhotel Aldiana Salzkammergut', 'Clubhotel Aldiana Salzkammergut', 'Die Anlage verfügt über 166 Zimmer. Alle Zimmer sind mit Bad oder Dusche, WC, Föhn, Kosmetikspiegel, Balkon oder Terrasse, Telefon, Internet, Fernseher/Radio, Minibar und Safe ausgestattet.\r\n\r\nDirekt verbunden mit der GrimmingTherme und nur ca. 10 Autominuten vom Skigebiet Tauplitz entfernt.\r\n\r\n', 'rezeption@Aldiana.at', 2, '(05352) 6 21 74', 'Salzburger Straße 32 6300 Wörgl (Kufstein)', 'Auf der Autobahn A1 kommend nehmen Sie die Ausfahrt Flughafen Salzburg und folgen der Innsbrucker Bundesstrasse Richtung Stadtzentrum. An der ampelgeregelten T-Kreuzung biegen Sie rechts in die Maxglaner Hauptstrasse. Dieser folgen Sie bis zum Gasthof Riedenburg wo Sie rechts in die Moosstrasse abbiegen. Biegen Sie an der zweiten Ampel links in die Nussdorferstrasse, welche in die Leopoldskroner Strasse übergeht. Von dort geht es gerade aus bis zum Hotel Schloss Leopoldskron. Wir freuen uns auf Sie!', 4, 4.29),
('Ferienhotel Kolmhof', 'Ferienhotel Kolmhof', 'Unsere familiengerechten Nichtraucherzimmer variieren zwischen großteils modernster Einrichtung und klassisch rustikalem Stil. Du gehst zu Bett und träumst!\r\n\r\nDas Hotel liegt direkt gegenüber der Therme St. Kathrein und inmitten der Skischaukel Bad Kleinkirchheim/St. Oswald.', 'rezeption@Kolmhof.at', 5, '(02752) 5 36 70', 'Dorfstraße 26 9546 Bad Kleinkirchheim', 'Mit dem Flugzeug\r\nEntfernung vom Hotel Central\r\n\r\nFlughafen Innsbruck ca. 85 km\r\nFlughafen München ca. 210 km\r\nFlughafen Salzburg ca. 150 km via Gerlospaß, ca. 180 km via Kufstein\r\nFlughafen Zürich ca. 370 km\r\nGerne sind wir Ihnen bei der Organisation eines Transfers behilflich.', 4, 1.22),
('Hotel Alte Post Großarl', 'Hotel Alte Post Großarl', 'Unser Hotel bietet komfortable und mit vielen heimischen Hölzern eingerichtete Hotelzimmer. Alle Zimmer sind mit Flat-Screen, größtenteils mit Balkon, Bad/Dusche und WC, Fön, Radio, kostenlosem W-Lan und vielem mehr ausgestattet.\r\n\r\nUnser Hotel ist nur 800 Meter vom Skilift entfernt (kostenloser Skibus direkt vor dem Hotel). \r\nKinderprogramm in den Sommerferien.', 'rezeption@AltePost.at', 4, '(05352)62174', 'Marktplatz 4 5611 Großarl', 'Aus nördlicher Richtung: über die A 22, Donauufer-Autobahn, dann auf die A 23, die Südosttangente, und auf dieser den Exit Gürtel nehmen. Aus östlicher Richtung: über die A 4, die Ostautobahn, dann auf die A 23, die Südosttangente, und auf dieser den Exit Gürtel nehmen. Aus südlicher Richtung: gleich auf die Südosttangente, und – welch Überraschung, auf dieser den Exit Gürtel nehmen. Aus westlicher Richtung: über die A 21, die Wiener Außenring Autobahn, dann auf die A 23, die Südosttangente, und auf dieser (wieder einmal) den Exit Gürtel nehmen.', 4, 3.29),
('Hotel Sonnblick', 'Hotel Sonnblick', 'Unsere 35 Nichtraucherzimmer und -suiten verfügen über Bad oder Dusche/WC, großen Balkon, Gesundheits-Wohlfühlbetten, Fön, Zimmersafe, Minibar, Digital TV, Radio, Telefon mit Weckfunktion sowie kostenloses W-Lan.\r\n\r\nCa. 3 Autominuten vom TAUERN SPA Zell am See - Kaprun entfernt. Mit dem kostenlosen Skibus erreichen Sie in wenigen Minuten verschiedene Skigebiete.', 'rezeption@eschenhof.at', 6, '(02254) 7 26 23', 'Schloßstraße 14 5710 Kaprun', 'Mit dem Auto: via Salzburg über die Pyhrn-Autobahn (A9) bzw. via Kärnten und die Süd-Autobahn (A2) bis Abfahrt Ilz, von dort aus Richtung Loipersdorf.?Aus Bayern: auf der Autobahn München Salzburg über die Tauern-Autobahn (A10) zur Phyrn-Autobahn (A9) Richtung Graz, oder auf der Autobahn Nürnberg-Passau in Richtung Linz und auf der Phyrn-Autobahn nach Graz, von dort auf der Süd-Autobahn (A2) Richtung Wien bis Abfahrt Ilz und dann weiter nach Loipersdorf.?Mit dem Zug: mehrmals täglich EC-Verbindung von München über Salzburg oder aus Richtung Innsbruck nach Graz und täglich ein EC-Autoreisezug Feldkirch – Graz von dort weiter nach Fürstenfeld und Richtung Loipersdorf per Bus oder Taxi.?Mit dem Flugzeug: tägliche Flugverbindung München-Graz. Ab Graz per Zug, Bus oder Taxi.', 5, 2.34),
('Ortners Eschenhof', 'Ortners Eschenhof', 'Die heimeligen Zimmer und Familienappartements sind modern eingerichtet: Badezimmer mit Dusche/WC (teilw. WC getrennt), Haarfön, Kosmetikspiegel, Designer-Badetasche aus Loden mit Bademantel und Badeschlappen für die Zeit Ihres Aufenthalts, Sat-TV, Telefon, WLAN, Schreibtisch und Zimmersafe. Zimmer teilweise mit Balkon/Terrasse.\r\n\r\n600 m von der Therme St. Kathrein entfernt. Ganztägige Kinderbetreuung von 08.00 Uhr bis 20.00 Uhr in der Hauptsaison (Nebensaison: 15.00 Uhr bis 20.00 Uhr). Das Hotel liegt inmitten der Skischaukel Bad Kleinkirchheim/St. Oswald.', 'rezeption@eschenhof.at', 5, ' (02252) 20 92 82', 'Wasserfallweg 12 9546 Bad Kleinkirchheim', 'Mit dem PKW\r\nInntalautobahn (A12) - Ausfahrt Zillertal, Bundesstraße B 169 oder mautfrei über Achensee oder über die Bundesstraße ab Kiefersfelden - Wörgl - Rattenberg\r\n\r\nMit der Bahn\r\nSchnellzugbahnhof Jenbach/Tirol, Zillertalbahn (Bahn oder Bus) bis Zell am Ziller', 2, 2.17),
('Thermenwelt Hotel Pulverer', 'Thermenwelt Hotel Pulverer', 'Vom gemütlichen Doppelzimmer bis zur Luxus-Familiensuite, hier wird der Charme eines persönlich geführten Hauses deutlich spürbar. Alle Zimmer sind mit Bad/WC (teilweise getrennt), Telefon, Sat-TV und Minibar ausgestattet. Die meisten Zimmer verfügen über einen Balkon.\r\n\r\nDas Hotel liegt direkt neben der St. Kathrein Therme und ist nur 450 Meter von der Skipiste entfernt.', 'rezeption@Thermenwelt.at', 5, '(03622) 5 37 26', 'Thermenstraße 4 9546 Bad Kleinkirchheim', 'A95 - Oberau - Ettal - Linderhof - Grenze Ammerwald - Plansee - Reutte - Lechtal -Warth -Hochkrumbach\r\n\r\nA8/A7/A96 Ulm - Memmingen - Lindau - (Österreichische Autobahn vignettenpflichtig) Bregenz - Dornbirn - Bregenzerwald/Bödele - Bezau - Schröcken - Hochkrumbach (mit dem Ausbau des Pfändertunnels wohl die schnellste Strecke aus dieser Richtung, landschaftlich schönes Stück durch den Bregenzerwald)', 5, 4.39);

