(1, 'Bad Ischl', 500, 500000, 'skifahrn, therme, bla', '');
INSERT INTO `ort` (`id`, `name`, `seehoehe`, `einwohner`, `aktivitaeten`, `Bild`) VALUES
(2, 'Bad Zell', 515, 2922, 'Natur und Kultur erleben in Bad Zell und seiner Umgebung  Umgeben von herrlicher Landschaft liegt Bad Zell im Naturpark Mühlviertel. Sanfte Hügel, Äcker und Wackelsteine dominieren diesen Landstrich. Dazwischen liegen vereinzelt malerische Vierkanthöfe. Diese reich strukturierte Kulturlandschaft auf ca. 500 m Seehöhe hat nichts von ihrem ursprünglichen Charme verloren, was auf das friedvolle Nebeneinander von Mensch und Natur zurückzuführen ist.   Der Kurort Bad Zell vereint all das, was für die Gesundheit so wichtig ist: die Heilquellen, das milde Mühlviertler Reizklima und die malerische Landschaft.  Von der Magerwiese bis zum Niedermoor bietet die Mühlviertler Alm Anziehungspunkte für Wanderfreunde und Naturliebhaber.', );
INSERT INTO `ort` (`id`, `name`, `seehoehe`, `einwohner`, `aktivitaeten`, `Bild`) VALUES
(3, 'Bad Hall', 500, 500000, 'skifahrn, therme, bla', ''),
(4, 'Großarl', 924, 3811, 'Winterurlaub im Schneeparadies Grossarltal Moderne Liftanlagen und herrliche sonnige Berghänge erwarten Sie Skibetrieb im Grossarltal von 01.12.2017 bis vorrauss. 08.04.2018 Großarl im Grossarltal präsentiert sich jeden Winter wieder in herrlichster weißer Pracht. Das \"Tal der Almen\" bietet gemeinsam mit der Region Dorfgastein Skivergnügen vom Feinsten. Die Skischaukel bietet ca. 73 Pistenkilometer für jeden Anspruch. Ein Snowpark mit ca. 500 m runden das Angebot ab. So steht dem aktiven Urlaub mit Familie oder Freunden nichts mehr im Weg.  Aber nicht nur die stets perfekt präparierten Pisten sprechen für einen Winterurlaub im Grossarlta, auch die herrlichen Angeboten an Wellness und Spa, einer Pferdekutschanfahrt oder die gemütliche Gastlichkeit und Köstlichkeiten im Grossarltal.  Genießen Sie Ihren Urlaub - die wohl schönste Zeit des Jahres - in intakter Natur und nutzen Sie gleichzeitig die unzähligen Sport- und Freizeitmöglichkeiten.', '');
INSERT INTO `ort` (`id`, `name`, `seehoehe`, `einwohner`, `aktivitaeten`, `Bild`) VALUES
(5, 'Bad Kleinkirchheim', 1087, 1708, 'Bad Kleinkirchheim ist eine Gemeinde mit 1708 Einwohnern (Stand 1. Jänner 2017) im Bezirk Spittal an der Drau in Kärnten. Der heute als Heilbad und Luftkurort ebenso wie als Skigebiet bekannte Ort in einem Tal der Gurktaler Alpen war zur Mitte des 20. Jahrhunderts noch vorwiegend bäuerlich geprägt. Obwohl der Sage nach der erste Kurgast bereits im 11. Jahrhundert Bad Kleinkirchheim als Erholungsgebiet zu schätzen wusste und im 17. Jahrhundert die ersten Badegäste den Ort besuchten, setzte erst vor wenigen Jahrzehnten ein einschneidender struktureller Wandel weg vom landwirtschaftlich und hin zum touristisch geprägten Bad Kleinkirchheim ein. Heute gehört die Gemeinde sowohl in der Sommer- als auch in der Wintersaison zu den zwanzig meistbesuchten Fremdenverkehrsorten Österreichs.', );
INSERT INTO `ort` (`id`, `name`, `seehoehe`, `einwohner`, `aktivitaeten`, `Bild`) VALUES
(6, 'Kaprun', 786, 3160, 'Kaprun ist eine Stadt südwestlich von Salzburg in den Österreichischen Alpen. Sie befindet sich am Fuße des Gletscher Kitzsteinhorn in der Hochgebirgsregion Hohe Tauern. Die Burg Kaprun stammt vermutlich aus dem 12. Jahrhundert. Im Süden führt ein hölzerner Steg über das rauschende Gletscherwasser und durch den engen Sigmund-Thun-Kamm. Hochgebirgswege bieten herrliche Aussicht auf die Stauseen Mooserboden und Wasserfallboden sowie die umliegenden Alpengipfel.', );

